import React from 'react';
import './about.css';
import Gsap from './Gsap';
import { Col } from 'reactstrap';

const About = () => {
	return (
		<div className="about" id="about">
			<h1 className="presentation">PRESENTATION</h1>
			<hr />
			<div className="columns">
				<Col md="12">
					<p className="name">Hello ! Moi c'est Kenny</p>
					<p className="me">
						Je suis développeur web fullstack autodidacte de 28 ans basé sur Avignon. Le développement web
						est une de mes passions, que je cultive durant mon temps libre. <br />J'ai toujours été
						passionné par l'UX-UI design, les créations web et toutes les dernières technologies. J'aime
						expérimenter, créer et relever de nouveaux défis.
					</p>
					<Gsap />
				</Col>
			</div>
		</div>
	);
};

export default About;
